<td style="text-indent: 0px; text-align: left;">
<span style="font-family: Arial; color: #000000; font-size: 12px; line-height: 1.1499023;">Nedílnou součástí této smlouvy jsou Úvěrové podmínky společnosti Zonky s.r.o. Z úvěrových podmínek, které jste dostal/a spolu s touto smlouvou, vybíráme několik důležitých bodů:<br/>- Úvěr vám poskytneme na bankovní účet, který jste za tímto účelem ve smlouvě uvedl/a. Okamžikem poskytnutí úvěru je den, kdy odešleme finanční částku dle smlouvy na váš bankovní účet.<br/>- Smlouvu uzavíráte on-line na portále Zonky.cz, a to se společností Zonky s.r.o., která uvedený portál provozuje. Smlouva se stává platnou v okamžiku, kdy ji podepíšete prostřednictvím verifikační SMS.<br/>- Pokud o participaci na celém vašem úvěru neprojeví zájem potřebné množství investorů, úvěr vám nemůžeme poskytnout.<br/>- Kdykoli můžete zaplatit více, než je předepsaná splátka. Částku, o kterou přesáhnete dohodnutou splátku, budeme automaticky považovat za mimořádnou splátku. Použijeme ji k uhrazení nesplacené jistiny a vypočítáme nový splátkový kalendář. Úvěr můžete splatit celý, nebo z části. U nás je to zdarma.<br/>- Pokud nám pošlete částku, která nebude stačit na uhrazení všech vašich závazků, budeme postupovat podle data jejich splatnosti. Nejprve z ní uhradíme nejstarší dlužné částky. Když jich bude několik mít stejné datum splatnosti, uhradíme je v tomto pořadí: 1. jistina, 2. úrok, 3. další příslušenství včetně sankcí.<br/>- Od smlouvy můžete odstoupit do 14 dnů od jejího uzavření, a to bez uvedení důvodu. Písemné odstoupení od smlouvy nám musíte zaslat na adresu našeho sídla uvedenou ve smlouvě, a to nejpozději v&nbsp;poslední den lhůty. Pokud vám před tím, než obdržíme vaše odstoupení od smlouvy, poskytneme úvěr, musíte nám úvěr vrátit i s úrokem do dne splacení jistiny (úrok se vypočítá na základě úrokové sazby dohodnuté ve smlouvě). K vrácení musí dojít bez zbytečného odkladu, nejpozději do 30 dnů ode dne odeslání odstoupení.<br/>- Smlouvu můžete ukončit odstoupením od smlouvy za podmínek uvedených v předešlém bodě nebo doplacením úvěru.<br/>- V několika výjimečných případech můžeme Váš úvěr zesplatnit. To znamená, že po Vás budeme chtít okamžitě vrátit půjčené peníze a budeme chtít, abyste zaplatil/a také úroky a platby za opožděné úhrady. Když nám peníze nevrátíte, budeme je po vás vymáhat za pomoci soudu. Můžeme to udělat, když:<br/>- zjistíme, že jste nám o sobě neříkal/a pravdu<br/>- na váš majetek bude zahájené insolvenční, exekuční nebo jiné řízení (včetně dědického)<br/>- porušíte smlouvu, kterou jsme spolu uzavřeli<br/>- nám 2 měsíce za sebou nepošlete splátku nebo nám budete 1 splátku dlužit déle než 3 měsíce<br/>- Kdykoliv v průběhu trvání smlouvy si můžete vyžádat výpis z účtu v podobě tabulky umoření.</span></td>
